import React from 'react'

import './SubjectTest'

const SubjectTest = ({ seconds }) => {

    const [countdown, setCountdown] = useState(seconds);
    const timerId = useRef();

    useEffect(() => {
        if (countdown <= 0) {
            clearInterval(timerId.current);
            alert("End");
        }
    }, [countdown]);
    const navigate = useNavigate();
    const startCountdown = () => {
        timerId.current = setInterval(() => {
            setCountdown((prev) => prev - 1);
        }, 1000);
        navigate('/Paper');

    };

    return (
        <div>
            <div className='test-card'>
                <div>
                    <h3>JEE MAIN 2024 TEST</h3>
                    <p>Available Till: 31 May,2024</p><br />
                    <p>FREE</p>
                </div>
                <div>
                    <div><span class="material-symbols-outlined">help</span><p>90 Questions</p></div>
                    <div><span class="material-symbols-outlined">
                        schedule
                    </span><p>180 Minutes</p></div>
                    <div><span class="material-symbols-outlined">
                        trending_up
                    </span><p>300 Marks</p></div>
                    <div className='test-btn'><button onClick={startCountdown} className='play-btn'><span class="material-symbols-outlined">
                        chevron_right
                    </span>Start Test</button></div>
                </div>
            </div>
        </div>
    )
}

export default SubjectTest
